function Profile(props: any){
    const[state , setstate] = useState<any>({})
    useEffect(() =>{
        setstate(props.items);
    },[props.items])
    return(
        <div>
            <h1></h1>
            {/* <img src={state?.items.profile_image}></img> */}
        </div>
    )
}

export default Profile;
